import re

def palindrome_of_length_at_least_n(string):
    string = re.sub('[^a-zA-Z]', '', string.lower())
    result = set()
    for i in range(len(string)):
        for j in range(i, len(string)):
            substring = string[i:j+1]
            if len(substring) >= 36 and substring == substring[::-1]:
                result.add(substring)
    return result
```
Note: The regular expression `[^a-zA-Z]` is used to remove all non-alphabetic characters from the string.
